var fixedelementPosition = document.getElementById('platform').offsetTop;
document.getElementById('mob-search')
    .addEventListener('click', function (event) {
        document.getElementById('mbSearch').classList.remove('search-hide');
        document.getElementsByClassName('header-logo')[0].style.display = "none";
        document.getElementsByClassName('head-text')[0].style.visibility = "hidden";
        document.getElementById('mob-search-box').select();
        document.getElementsByClassName('e-input-group e-control-wrapper e-ddl')[0].classList.add('e-input-focus');

    });
function hideSearch() {
    document.getElementById("mbSearch").classList.add("search-hide");
    document.getElementsByClassName('header-logo')[0].style.display = "block";
    document.getElementsByClassName('head-text')[0].style.visibility = "visible";
    document.getElementById("mob-search").classList.add("sb-icons", "mb-search");
    document.getElementById("mob-search").classList.remove("search-hide");

}

document.getElementById('searching').addEventListener('click', function (event) {
    document.getElementById("mob-search").classList.remove("sb-icons", "mb-search");
    document.getElementById("mob-search").classList.add("search-hide");
});
function hideSearchDesktop() {
    document.getElementById("mob-search").classList.remove("search-hide");
    document.getElementById("mob-search").classList.add("sb-icons", "mb-search");
}

function mobilefocus() {
    document.getElementById("mob-search").classList.remove("sb-icons", "mb-search");
    document.getElementById("mob-search").classList.add("search-hide");
}
function fixedmenu() {
    var ele = document.getElementById('platform');
    var EletopPosition = ele.offsetTop;
    var screnPosition = $(window).scrollTop();

    if (screnPosition > EletopPosition && screnPosition >= fixedelementPosition) {
        ele.classList.add('fixed-menu');
    } else {
        ele.classList.remove('fixed-menu');
    }
}

